INSERT INTO `products` (`id`, `name`, `brand`, `category_id`, `description`, `image_url`, `base_price`, `unlisted`, `created_at`) VALUES
(2, 'Duramo 10', 'Adidas', 1, 'From a morning gym session to a day of errands to an evening with friends, keep your feet comfortable and your style on point in these adidas shoes. Pair them with your favourite running shorts for the ultimate athletic-casual vibe. A mesh upper helps you stay cool, while superlight cushioning cradles every step you take.\r\n\r\nMade with a series of recycled materials, this upper features at least 50% recycled content. This product represents just one of our solutions to help end plastic waste.', 'Duramo_10.avif', 89.00, 0, '2025-03-08 18:28:51'),
(3, 'Nike Blazer Mid Vintage', 'Nike', 4, 'In the &#38;#39;70s, Nike was the new shoe on the block. So new in fact, we were still breaking into the basketball scene and testing prototypes on the feet of our local team. Yeah. Of course, the design improved over the years, but the name stuck. The Nike Blazer Mid &#38;#39;77 Vintage—classic since the beginning.', 'BLAZER_MID_\'77_VNTG.png', 159.00, 0, '2025-03-08 18:44:58'),
(5, 'Tatum 3 PF', 'Nike', 6, 'Made for movers and shakers, the Tatum 3 offers a contouring fit in a lightweight design, helping you dominate the game in the smoothest of fashion. Sound familiar? A strong but flexible upper gives you the containment and stretch that quick cuts and dynamic movements demand. So, whether you\'re breaking records or ankles, you can shift in and out of action just like the champ himself. No pressure.', 'JORDAN_TATUM_3_PF.png', 209.00, 0, '2025-03-08 18:48:02'),
(6, 'F50 League Messi Turf Boots', 'Adidas', 7, 'Legendary F50 pace. Mesmerising Messi skills. Part of a range built to match the GOAT\'s on-field preferences, these adidas League football boots have a flexible HybridTouch upper with a comfortable synthetic tongue. The lug rubber outsole offers propulsion on artificial turf.\r\n\r\nThis product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', 'F50_League_Messi_Turf_Boots_Silver.avif', 129.00, 0, '2025-03-08 19:50:42'),
(7, 'Full Force Low', 'Nike', 4, 'A new shoe with old-school appeal—your retro dreams just came true. This pared-back design references the classic AF-1, then leans into the \'80s style with throwback stitching and varsity-inspired colours. Not everything has to be a throwback, though—modern comfort and durability make them easy to wear any time, anywhere. Time to throw them on and go full force.', 'NIKE_FULL_FORCE_LO.png', 145.00, 0, '2025-03-08 19:56:26'),
(8, 'Nike Vomero 18', 'Nike', 1, 'Maximal cushioning in the Vomero provides a comfortable ride for everyday runs. Our softest, most cushioned ride has lightweight ZoomX foam stacked on top of responsive ReactX foam in the midsole. Plus, a redesigned traction pattern offers a smooth heel-to-toe transition.', 'NIKE_VOMERO_18.png', 229.00, 0, '2025-03-08 22:04:17'),
(9, 'Nike Vaporfly 3', 'Nike', 1, 'Catch \'em if you can. Giving you race-day speed to conquer any distance, the Nike Vaporfly 3 is made for the chasers, the racers, the elevated pacers who can\'t turn down the thrill of the pursuit. We reworked the leader of the super shoe pack and tuned the engine underneath to help you chase personal bests from a 10K to marathon. From elite runners to those new to racing, this versatile road-racing workhorse is for those who see speed as a gateway to more miles and more seemingly uncatchable highs.', 'ZOOMX_VAPORFLY_3.png', 339.00, 0, '2025-03-08 22:07:20'),
(10, 'Nike Winflo 11', 'Nike', 1, 'Responsive cushioning provides a balanced ride for everyday runs. Experience energy return with a combination of Cushlon 3.0 foam and a full-length Nike Air unit in the midsole. Plus, an elastic midfoot band and a spacious forefoot provide an accommodating, comfortable fit.', 'NIKE_AIR_WINFLO_11.png', 165.00, 0, '2025-03-08 22:13:58'),
(11, 'Converse x Comme des Garçons Chuck 70 Beige', 'Converse', 3, 'The one heart that started it all: Our iconic collaboration with PLAY Comme des Garçons returns with an ode to the OG Chucks that launched the partnership in 2009. On a minimalist Chuck 70, the throwback design features a single heart logo on the canvas while keeping classic Converse details untouched. It only takes one heart to make a splash.', 'converseXcdgChuck70Beige.jpg', 219.00, 0, '2025-03-08 22:19:07'),
(13, 'Kobe V Protro \'Year of the Mamba\'', 'Nike', 6, 'On the court, Kobe was intuitive, strategic and intelligent. And the snake in the Chinese zodiac shares these same attributes. This Kobe V Protro \'Year of the Mamba\' colourway is inspired by Kobe\'s preference for choosing to do things the hard way every day. We took a great basketball shoe and made it even better by upgrading the traction and cushioning and then dressing it in a familiar purple hue. Snakeskin details on the heel are paired with a striking golden snake graphic that wraps around the iconic Swoosh logo, adding new but recognisable details to this classic silhouette', 'Kobe_V_Protro_Year_of_the_Mamba.jpg', 289.00, 1, '2025-03-12 10:27:16'),
(16, 'Nike Mercurial Superfly 10 Elite AS', 'Nike', 7, 'Obsessed with speed? So are the game\'s biggest stars. That\'s why we made this Elite boot with an improved 3/4-length Air Zoom unit. It gives you and the sport\'s fastest players the propulsive feel needed to break through the back line. The result is the most responsive Mercurial we\'ve ever made because you demand greatness from yourself and your footwear.', 'Nike_Mercurial_Superfly_10_Elite_AS.png', 425.00, 0, '2025-03-12 10:35:42'),
(18, 'Nike Air Force 2', 'Nike', 4, 'Comfortable, durable and timeless—it&#39;s number one for a reason. The classic construction pairs smooth leather with bold details for style that tracks whether you&#39;re on court or on the go.', 'Nike_Air_Force_1.png', 165.00, 0, '2025-03-12 10:39:29'),
(22, 'Nike Promina', 'Nike', 4, 'The Nike Promina makes every walk a soft ride. Its tall foam stack is combined with a grooved rocker on the outsole, providing high cushioning for all-day comfort.', 'Nike_Promina.png', 99.00, 0, '2025-03-13 10:17:18'),
(25, 'Samba OG Shoes', 'Adidas', 6, 'Born on the pitch, the Samba is a timeless icon of street style. This silhouette stays true to its legacy with a tasteful, low-profile, soft leather upper, suede overlays and gum sole, making it a staple in everyone&#39;s closet - on and off the pitch.', 'Samba_OG_Shoes.avif', 179.00, 0, '2025-03-14 04:34:09'),
(26, 'Supernova Rise 2 Running Shoes', 'Adidas', 1, 'You got into running, and now there\'s a race on your calendar. Keep making progress in these adidas running shoes for daily runs. They ride on a Dreamstrike+ midsole, our lightweight super foam tuned for comfort. Support Rods help guide you from heel strike to toe off. Our new refined engineered sandwich mesh upper and premium heel construction is elegantly designed for optimized breathability for our most comfortable fit yet. Recognized by the American Podiatric Medical Association for promoting good foot health; this is Supernova Rise 2.', 'Supernova_Rise_2_Running_Shoes.avif', 189.00, 0, '2025-03-14 05:20:40'),
(27, 'Adizero Adios 9 Running Shoes', 'Adidas', 1, 'There are 13.1 miles between you and the finish line. Get there in record time in these adidas running shoes. Light, fast and powered by a full-length Lightstrike Pro midsole, they\'re ready for training runs or race day. A small stiffening element in the midsole supports fast transitions, and a stretch mesh upper enhances comfort. This product features at least 20% recycled materials. By reusing materials that have already been created, we help to reduce waste and our reliance on finite resources and reduce the footprint of the products we make.', 'Adizero_Adios_9_Running_Shoes.avif', 189.00, 1, '2025-03-14 06:00:07'),
(28, 'Adizero Mississipi 12 Shoes', 'Adidas', 6, 'The Boston Marathon is a race. But it&#39;s also a goal, and a training plan and all the days it stays on your mind before the big one. The Adizero Boston 12 Shoes are built for mid- to long-distance running. They bring a race-day feel to training with a propulsive feel that comes from the glass-fibre infused ENERGYRODS 2.0, which limit energy loss underfoot. They&#39;re fast, but that does not come at the cost of durability — the midsole layers ultra-light LIGHTSTRIKE PRO cushioning with a new version of durable LIGHTSTRIKE 2.0 EVA.', 'Adizero_Boston_12_Shoes.avif', 209.00, 1, '2025-03-14 06:28:21'),
(32, 'Superstar', 'Adidas', 4, 'The iconic adidas Superstar shoes are back. Step into 50 years of sport and street style with these low top sneakers. A smooth leather upper and rubber shell toe evoke memories of basketball courts and city streets. The padded tongue and collar add comfort for all-day wear while the textured rubber outsole provides grip. Whether you&#39;re shooting hoops or hitting the town, the adidas Superstar shoes have the versatility and retro appeal to take you there in classic style.', 'Superstar.avif', 159.00, 0, '2025-03-27 16:53:27'),
(33, 'Air Max Dn8', 'Nike', 6, 'More Air, less bulk. The Dn8 takes our Dynamic Air system and condenses it into a sleek, low-profile package. Powered by eight pressurised Air tubes, it gives you a responsive sensation with every step. Enter an unreal experience of movement.', 'Air_Max_Dn8.png', 279.00, 0, '2025-04-03 08:31:26'),
(34, 'Pegasus Premium', 'Nike', 1, 'The Pegasus Premium supercharges responsive cushioning with a triple stack of our most powerful running technologies: ZoomX foam, a sculpted Air Zoom unit and ReactX foam. It&#39;s the most responsive Pegasus ever, providing high energy return unlike any other. With a lighter-than-air upper, it decreases weight and increases breathability so you can fly faster.', 'Pegasus_Premium.jpg', 299.00, 0, '2025-04-03 08:34:11'),
(35, 'Pegasus Trail 5', 'Nike', 1, 'Spread your wings and see what nature brings as you chase earthy paths in the Peg Trail 5. Now equipped with an ultra-responsive ReactX foam midsole, this shoe is a true dual threat raring to cross the divide between dirt and drives.', 'Pegasus_Trail_5.jpg', 229.00, 0, '2025-04-03 08:36:02'),
(36, 'Sonic Fly', 'Nike', 1, 'Fuel their need for speed in the Nike Sonic Fly. Designed for fast runners in the making, it pairs a lightweight design with soft, springy foam that helps add energy to every stride.', 'Sonic_Fly.png', 95.00, 0, '2025-04-03 08:38:19'),
(37, 'Chuck Taylor All Star Wedge', 'Converse', 4, 'You don’t have work for these DIY vibes. Pearls, studs, and deco-stitching take over these platform Chucks for a crafted look that’s truly effortless.', 'Chuck_Taylor_All_Star_Wedge.jpg', 149.00, 0, '2025-04-03 08:42:31'),
(38, 'Chuck Taylor All Star Dainty Ballerina', 'Converse', 5, 'Taking cues from ballet flats, the Dainty Ballerina pairs a clean, low-profile design with signature Chuck Taylor details. No dancing skills necessary.', 'Chuck_Taylor_All_Star_Dainty_Ballerina.jpg', 89.00, 0, '2025-04-03 08:44:21'),
(39, 'Run Star Hike Canvas Platform', 'Converse', 4, 'The iconic Converse Chuck Taylor All Star high top gets reimagined in the Run Star Hike. Lace-up canvas keeps it classic from the front, while a contrast-color star on the heel lets ‘em know what’s new. Colorblocking draws attention to the platform midsole and statement, saw-toot outsole. Look again.', 'Run_Star_Hike_Canvas_Platform.jpg', 149.00, 0, '2025-04-03 08:45:35'),
(40, 'Chuck-E-Cheese Taylor All Star Shoreline', 'Converse', 4, 'Created in 1917 as a non-skid basketball shoe, the All Star was originally promoted for its superior court performance by basketball mastermind Chuck Taylor. But over the decades, something incredible happened: The sneaker, with its timeless silhouette and unmistakable ankle patch, was organically adopted by rebels, artists, musicians, dreamers, thinkers and originals.', 'Chuck_Taylor_All_Star_Shoreline.jpg', 89.00, 0, '2025-04-03 08:46:41'),
(41, 'Converse x Tom and Jerry Chuck 70', 'Converse', 4, 'Express your personal style with a pair of shoes from Converse. Our range of shoes and trainers are built for ultimate comfort and timeless street style. With a stylish and iconic silhouette, Converse offers a wide variety of shoes to suit your personality.', 'Converse_x_Tom_and_Jerry_Chuck_70.jpg', 139.00, 0, '2025-04-03 08:49:49'),
(42, 'Sport Low Keepsake', 'Vans', 4, 'The name Hoe of Vans is coined Early 70s Skateboarders who like Vans rugged make-up and sticky sole are seen sporting for the first time and is showcased on the windows of the Anaheim location.', 'Sport_Low_Keepsake.jpg', 99.99, 0, '2025-04-03 09:00:14'),
(43, ' Hylane', 'Vans', 4, 'The name House of Vans is coined Early 70s Skateboarders who like Vans rugged make-up and sticky sole are seen sporting for the first time and is showcased on the windows of the Anaheim location.', '_Hylane.jpg', 80.50, 0, '2025-04-03 09:02:02'),
(44, 'La Costa Slide-On', 'Vans', 4, 'Slip into comfort with the Checkerboard La Costa Slide-On.', 'La_Costa_Slide-On.jpg', 48.05, 0, '2025-04-03 09:04:03'),
(45, 'Vans Unisex LX Slip-On MTE x Nicole McLaughlin', 'Vans', 4, 'Discover the latest collaboration with Nicole McLaughlin in Spring 2025—where sustainability meets innovation. Thoughtfully designed with eco-conscious materials and mindful craftsmanship, each piece reflects a commitment to reducing environmental impact without compromising on quality or style. With durable, responsibly sourced components and functional design details, this collection reimagines everyday essentials with a fresh perspective. Inspired by creative upcycling and a passion for sustainability, every element is crafted to support a more thoughtful way of living. Step into a greener future with the new Vault by Vans x Nicole McLaughlin collection—designed for those who care about the planet as much as their style.', 'Vans_Unisex_LX_Slip-On_MTE_x_Nicole_McLaughlin.jpg', 299.00, 0, '2025-04-03 09:04:49'),
(46, 'Vans Unisex LG Slip-Of MTE x Aik Kai', 'Vans', 6, 'Thoughtfully designed with eco-conscious materials and mindful craftsmanship, each piece reflects a commitment to reducing environmental impact without compromising on quality or style. With durable, responsibly sourced components and functional design details, this collection reimagines everyday essentials with a fresh perspective.', 'Vans_Unisex_LG_Slip-Of_MTE_x_Aik_Kai.jpg', 399.00, 1, '2025-04-03 09:06:35'),
(47, 'U Classic Slip-On', 'Vans', 4, 'The name House of Vans is coined Early 70s Skateboarders who like Vans rugged make-up and sticky sole are seen sporting for the first time and is showcased on the windows of the Anaheim location.', 'U_Classic_Slip-On.jpg', 89.00, 0, '2025-04-03 09:09:06'),
(48, 'Vans x Asian Artist Collection Unisex Knu Skool', 'Vans', 4, 'Bolin is a talented artist from China who distinguishes himself with his traditional Chinese painting style of ironic black watercolor, effortlessly catch the eye amidst a sea of artists. By using his expertise of ancient Chinese painting techniques, Bolin has created a series of whimsical illustrations featuring skateboarders with heart-shaped heads. The narrative he presents this time is ?Love in the Sky?, which celebrates skaters? love, passion, and their pursuit of freedom. These illustrations are featured on the Vans Knu Skool shoes, as well as prints on a matching jacket, crewneck fleece, baggy pants, and a beanie set. The Knu Skool is a reissued model from the 90s, when skate shoes were extra puffy. Made with sturdy suede uppers, this low top silhouette features a big puffy tongue and ankle collar, giving it an exaggerated look that plays off of the original Old Skool. Keeping the Off The Wall aesthetic, our iconic Vans Sidestripe has been re-envisioned as a puffy diamond 3D mold, adding to the overall chunky look and feel. The addition of heel pulls offers easy access in and out.', 'Vans_x_Asian_Artist_Collection_Unisex_Knu_Skool.jpg', 129.00, 0, '2025-04-03 09:10:23'),
(49, 'Ave 2.0 Knit Shoe', 'Vans', 8, 'Vans joins forces with legendary skate team rider Anthony Van Engelen, better known as AVE, to deliver Vans Skateboarding’s most technical and progressive performance model yet: the AVE 2.0 Knit. Leading the way in performance, fit, and style, the AVE 2.0 Knit is built with UltimateWaffle technology and an engineered knit upper for a locked-in fit. With a career spanning more than two decades, AVE’s skating has evolved just as much as his product innovations. With the AVE 2.0 Knit, he continues to push Vans products further, reinforcing that “good enough can always be better.&#13;&#10;', 'Ave_2.0_Knit_Shoe.jpg', 175.00, 0, '2025-04-03 09:11:31'),
(50, 'Color Theory Classic Slip-On', 'Vans', 3, 'The Color Theory Collection allows you to create a unique color story by pairing vibrant, unexpected hues with our iconic footwear styles. Made with an old school canvas upper featuring our signature checkerboard print, this seasonal Classic Slip-On Checkerboard honors our legendary laceless silhouette while offering a fresh look that boosts the appeal of this easy-to-wear shoe.', 'Color_Theory_Classic_Slip-On.jpg', 95.00, 0, '2025-04-03 09:12:53'),
(51, 'Color Theory Authentic', 'Vans', 3, 'The Color Theory Collection allows you to create a unique color story by pairing vibrant, unexpected hues with our iconic footwear styles. Made with an old school canvas upper, this seasonal Authentic honors our original Vans silhouette while offering a fresh look that boosts the appeal of this timeless shoe.', 'Color_Theory_Authentic.jpg', 150.00, 0, '2025-04-03 09:13:32');
